import React from "react";

import { SearchBarContainer, SearchBarInput } from "./SearchBar.styles";

const SearchBar = ({ search, HandleChange }) => {
	return (
		<SearchBarContainer>
			<SearchBarInput
				placeholder={"Search"}
				value={search}
				onChange={HandleChange}
			/>
			<i class="fas fa-search"></i>
		</SearchBarContainer>
	);
};

export default SearchBar;
